import React from "react";

const Footer = () => (
    <footer className=" w-full text-white p-10 ">
        <div className=" w-[80%] flex justify-between items-center gap-10 bg-primary text-white  py-8 px-14 mx-auto rounded-xl ">
            <p className=" text-center font-semibold text-7xl ">
                Ready to work with us?
            </p>
            <button className="bg-white hover:bg-primary text-primary hover:text-white font-medium border border-primary px-6 py-4 rounded-full">
                Get Started
            </button>
        </div>

    </footer>
);

export default Footer;
